import React, { Fragment } from 'react';
import './home.css';


const Home = () => (
  <>
  <Fragment>
    <Navigation key="navigation" />
    <h1 className="title"><span>Начальная страница ETU_Bot</span></h1>
    <p>Здесь будет находиться основная информация о боте.</p>
  </Fragment>
  </>
);

export default Home;
